      <h2>Edit Form</h2>
      <label>
        Name:
        <input
          type="text"
          value={"bob"}
          onChange={(e) => setName(e.target.value)}
        />
      </label>
      <label>
        Age:
        <input
          type="number"
          value={"jill"}
          onChange={(e) => setAge(e.target.value)}
        />
      </label>
      <button type="submit">Save</button>
    </form>
  );
}

